import "./css/sign.css";
import signImage from "../assets/signImage.jpg";
import Input from "../components/Input";
const Sign = () => {
  return (
    <main className="mainLogin">
      <div className="esq1">
        <img src={signImage} alt="" />
      </div>
      <div className="dir1">
      <h2>Bem vindo(a)</h2>
        <form>
          <Input type="e-mail" placehoder="E-mail" />
          <Input type="password" placehoder="Senha" />
        </form>
        <button>Entrar</button>
      </div>
    </main>
  );
};

export default Sign;
